                this.getLocation();
            //    sent position
            },
            late() {
                this.$toasted.info("Notification is sent");

            },
            getLocation() {
                let pos = [];
                if (navigator.geolocation) {
                    navigator.geolocation.getCurrentPosition(
                        function (position) {
                            const lat = position.coords.latitude;
                            const lon = position.coords.longitude;
                            pos.push(lat);
                            pos.push(lon);
                        });
                    this.position = pos;
                }
            },
